import React from 'react'
import './formstyle.css'

function Formcomponent() {
    function check(){
        var get=document.getElementById("password");
        if(get.value.trim().length<5){
            alert("Password is short must be greater than 5");
            return false;
        }
    }
    return (

            <div className="box" >
                <div className="animation"> 
                <center><figure><img></img></figure></center>
              <center><h2 ><strong>Log in to instatweets</strong></h2></center> 
                <form  action="">
                <label><h4>phone,email,or username</h4></label>
                    <input type="text" class="form-control"  required></input>

                    <label >Password</label>
                    <input type="password" class="form-control" id="password" required></input>  

                    <a href="#" onClick={check} className=" btn btn-white" >Log in</a>
                 <center><a href="#">Forgot password?.</a></center>
                <center><a href="#">Sign up for instatweets?.</a></center> 
                </form>

                </div>
                </div> 


    )
}

export default Formcomponent
